import React from "react";
import {Button} from "reactstrap";

const range = len => {
  const arr = [];
  for (let i = 0; i < len; i++) {
    arr.push(i);
  }
  return arr;
};

const newTransfer = () => {
  return {
    reference: transfer.reference,
    executionDate: transfer.executionDate,
    principalAccount: transfer.principalAccount,
    beneficiaryAccount: transfer.beneficiaryAccount,
    transactionAmount: transfer.transactionAmount,
    stateAction: "okkk"
  };
};

export function makeData(len=333) {
  return range(50).map(transfer => {
    return {
      ...newTransfer(transfer),
      children: range(10).map(newTransfer)
    };
  });
}
